function getActionBasedOnDate(date: Moment) {
  const dateWithoutTime = date.startOf('d');
  const todaysDate = moment().startOf('d');
  const dateDayDifference = todaysDate.diff(moment(dateWithoutTime), 'days', true) - 1;
  switch (dateDayDifference) {
    case 0: return GET_TODAYS_FIXTURES
    case -0: return GET_TODAYS_FIXTURES

    case -1: return GET_ONE_DAY_AGO_FIXTURES
    case -2: return GET_TWO_DAYS_AGO_FIXTURES
    case -3: return GET_THREE_DAYS_AGO_FIXTURES
    case -4: return GET_FOUR_DAYS_AGO_FIXTURES
    case -5: return GET_FIVE_DAYS_AGO_FIXTURES
    case -6: return GET_SIX_DAYS_AGO_FIXTURES
    case -7: return GET_SEVEN_DAYS_AGO_FIXTURES

    case 1: return GET_ONE_DAY_FUTURE_FIXTURES
    case 2: return GET_TWO_DAYS_FUTURE_FIXTURES
    case 3: return GET_THREE_DAYS_FUTURE_FIXTURES
    case 4: return GET_FOUR_DAYS_FUTURE_FIXTURES
    case 5: return GET_FIVE_DAYS_FUTURE_FIXTURES
    case 6: return GET_SIX_DAYS_FUTURE_FIXTURES
    case 7: return GET_SEVEN_DAYS_FUTURE_FIXTURES
  }
}

function groupFixturesListByLeagueId(data: any) {
  const groupedData = _.groupBy(data, function (currentObject: any) {
    return currentObject.league.id;
  })
  const arrayData = Object.keys(groupedData).map((key) => groupedData[key]);

  return arrayData;
}

